                    oNewGroup = oTmpGroup;
                    nNewGroupIndex = nTmpGroupIndex;
                    
                    if (oOldGroup.isDefaultGroup && nOldGroupIndex != nNewGroupIndex && oOldGroup.tiles.length <= 1) {
                        that.toggleDefaultGroupVisibility(false);
                    }
